import './App.css';

function App() {
  return (
    <div className="App">
        <header>
          <a href="#idPos">MAIN</a>
          <a href="#">INTRODUCE</a>
          <a href="#">WORK</a>
          <a href="#">CONTACT</a>
        </header>
        <div className="main-container" id='idPos'>
          <div className="round-container"></div>
          <div className="title-container">
            <h1>WELCOME TO MY PORTFOLIO</h1>
            <p>안녕하세요! 끊임없이 도전하고, 나아가 프론트엔드 개발자가 되고 싶은 신입 웹 퍼블리셔 최제원입니다.</p>
          </div>
        </div>
    </div>
  );
}

export default App;
